import React from 'react'
import Header from "./Header/Header"
import './App.css';
import SideBar from './SideBar/SideBar';
import EmailList from "./"
import Compose from './Compose/Compose';

function Routerer() {
  return (
    
         <div>
      <Header />
      <div className='app__body'>
      <SideBar />
      <EmailList />
      </div>
      <Compose />
    </div>

  )
}

export default Routerer
